import React, { Component } from 'react'
import Task from './Task'

export class TaskList extends Component {
    render() {
        return (
            <div className="tasks">
                <h5>Tasks</h5>
                <div>
                    {this.props.tasks.map(task => <Task key={tasks.text} task={task}/>)}
                </div>


            </div>
        )
    }
}

export default TaskList
